import './App.css';
import { useState, useEffect } from 'react'

const data = (setData) => { 
  fetch("https://datausa.io/api/data?drilldowns=Nation&measures=Population").then(function (response) {
    return response.json();
  }).then(function (response) {
    setData(response);
  })
}

function draw(fetch_data) {
  return <table>
    { fetch_data.map( i => {
      <tr>
        { i.map( j => {
          return <td> j </td>
        } ) }
      </tr>
    } ) }
  </table>
}

function App() {
  const [fetch_data, setData] = useState();
  useEffect(() => {
    data(setData);
  }, []);
  return (
    <div className="App">
      <Draw value={fetch_data} />
    </div>
  );
